import React from 'react';
import './Element.scss';

const Element = (props) => {
	if (props.color === "green")
		return <p className="green-element">{props.value}</p>;
	if (props.color === "pink")
		return <p className="pink-element">{props.value}</p>;
	if (props.bordered === true)
		return <p className="bordered-element">{props.value}</p>;
	return <p className="element">{props.value}</p>;
}

export default Element;
